import { Component, OnInit } from '@angular/core';
import { GamesByStudio } from '../types';

@Component({
  selector: 'app-q4',
  templateUrl: './q4.component.html',
  styleUrls: ['./q4.component.css']
})
export class Q4Component implements OnInit{
  GamesByStudios: GamesByStudio[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getTopPerGame()
      .subscribe(GamesByStudios => this.GamesByStudios = GamesByStudios);
  }
}
